          caption:
            "The student who designed the Nike logo for $35 is a millionaire now, but not for the reasons you think.\n\nIn 1971, Carolyn Davidson was a graphic design student at Portland State University when Phil Knight asked her to create a logo for his startup shoe company. She worked on the Swoosh and was paid just $35. Most people see this as exploitation‚Äîa billion-dollar brand built on a design worth pennies. But the real story is different. Years later, Knight gave Davidson stock in Nike that made her a millionaire, proving he never forgot her contribution.\n\nThis reveals something powerful about long-term thinking. Davidson didn't demand equity upfront or refuse the work because the pay seemed unfair. She delivered value, stayed connected, and was rewarded when Nike became a global empire. Knight didn't legally owe her anything more, but he chose to recognize what she helped build.\n\nThe lesson is timeless. Do great work even when the immediate reward seems small. The right people remember, and loyalty compounds over time into opportunities you can't imagine.\n\nFollow @luxemindco for the insights that drive successful founders & entrepreneurs.\n\n#nike\n#logo\n#success\n#business\n#design",
